const CoinPrice = () => {

    const [coin,getCoin] = useState()


    fetch("https://api.upbit.com/v1/ticker?markets=krw-btc,krw-eth")
    .then(res => res.json())
    .then (res => getCoin(res[0].change_price));




    return(
        <div>
          {coin}
        </div>
    )

}

export default CoinPrice;
